import styled from 'styled-components';
import 'typeface-quicksand';
export const Div0 = styled.div`
    width: 100%;
    margin: 0 auto;
    height:100vh;
    overflow: auto;
    min-width: 1250px;
    max-width: 1920px;
    &::-webkit-scrollbar {

      width: 7px;

    }

  &::-webkit-scrollbar-button {

      background: transparent;

      border-radius: 4px;

    }

  &::-webkit-scrollbar-track-piece {

      background: transparent;

    }

  &::-webkit-scrollbar-thumb {

      border-radius: 4px;

      background-color: rgba(0, 0, 0, 0.4);

      border: 1px solid slategrey;

    }

  &::-webkit-scrollbar-track {

      box-shadow: transparent;

    }

`


export const ContentDiv =styled.div`
    background-color:#F5F5F5;
    overflow:auto;
    min-height:500px;
    display: flex;
    justify-content: center; 
    align-items: center; 
    &::-webkit-scrollbar {

      width: 7px;

    }

  &::-webkit-scrollbar-button {

      background: transparent;

      border-radius: 4px;

    }

  &::-webkit-scrollbar-track-piece {

      background: transparent;

    }

  &::-webkit-scrollbar-thumb {

      border-radius: 4px;

      background-color: rgba(0, 0, 0, 0.4);

      border: 1px solid slategrey;

    }

  &::-webkit-scrollbar-track {

      box-shadow: transparent;

    }
    
`
export const SearchDiv =styled.div`
    width:300px;
    height:200px;
    border: 3px solid #7c9c99;
    margin: auto;
    border-radius:10px;
`
export const SearchTitle =styled.div`
    font-size:24px;
    color:#445553;
    font-family:arial;
    padding-top:20px;
    padding-left:10px;
`
export const DivLog = styled.div`
    height:45px;
    width:250px;
    font-size:14px;
    border-radius:4px;
    border: 1px solid #7c9c99;
    font-family:arial;
    display: flex;
    justify-content: center;
    align-items: center;

`
export const InPutL = styled.input`
    height:45px;
    width:250px;
    font-size:14px;
    border-radius:4px;
    border: 0;
    outline: none;
    background-color: rgba(0, 0, 0, 0);
    font-family:arial;

`
